import { useState } from "react";

function App() {
  //TODO: Presentar el concepto STATE
//hooks

const [pruebaState, setPruebaState] = useState("Titulo");

  const handleChangePrueba = (event) => {
    setPruebaState(event.target.value);
  }


  return (
    <div className="App">
      <h3>Notas</h3>
      <label htmlFor="pruebaID">Input prueba</label>
      <input 
       id="pruebaID" 
       name="prueba" 
       type="text" 
       onChange={handleChangePrueba}
       value={pruebaState}/>


      <label htmlFor="fecha">Input prueba</label>
      <input 
       id="fecha" 
       name="fecha" 
       type="text" 
       onChange={handleChangePrueba}
       value={fechaState}/>


      <label htmlFor="nota">Input prueba</label>
      <input 
       id="nota" 
       name="nota" 
       type="text" 
       onChange={handleChangePrueba}
       value={notaState}/>
    </div>
  );
}

export default App;
